import React, { Component } from 'react'
import logo from '..\public\Green_logo.png'
import './home.css'

export default class Home extends Component {
    constructor(props){
        super(props)
        this.state = {
            display: true, 
            autoplay: false,
        }
    }
    

render(){
    return(
        <div className='header'>
            <img id="Green_Logo" src={logo} style = {{Green_logo}}/>
        </div>
    )
}

}

const Green_logo = {
    width: '50 px', 
    height: '50 px',
    position: 'fixed', 
}
